import React from 'react'

const Input = (props) => {
  return (
    <div className={props.className}>
      <label className='font-bold mr-4' htmlFor={props.input.id}>{props.label}</label>
      <input className='w-12 rounded-xl border' {...props.input} />
    </div>
  )
}

export default Input
